import React, { useEffect } from "react";
import { useParams } from "react-router";
import { fetchData } from "../services/clients";

function Order() {
  const { id } = useParams();

  const func = async () => {
    const order = fetchData("GET", `/get-order/${id}`);
  };

  useEffect(() => {
    func();
  }, []);

  return <div>Order</div>;
}

export default Order;
